import React from "react";
import { useState } from "react";
import Header from "../partials/Header";
import "./Assests/css/search.css";

export default function Login() {
  const [name, setName] = useState("");
  const [dataHospital, setDataHospital] = useState("");
  const [dataDoctor, setDataDoctor] = useState("");

  const onSubmit = async (e) => {
    e.preventDefault();

    try {
      let responseHospital = await fetch("http://localhost:5000/findHospital", {
        method: "post",
        body: JSON.stringify({ name }),
        headers: {
          "Content-Type": "application/json",
        },
      });

      let responseDoctor = await fetch("http://localhost:5000/findDoctor", {
        method: "post",
        body: JSON.stringify({ name }),
        headers: {
          "Content-Type": "application/json",
        },
      });

      if (responseHospital.ok) {
        let data = await responseHospital.json();
        setDataHospital(data);
        console.log("Data received:", data);
      } else {
        console.error("Error:", responseHospital.statusText);
      }

      if (responseDoctor.ok) {
        let data = await responseDoctor.json();
        setDataDoctor(data);
        console.log("Data received:", data);
      } else {
        console.error("Error:", responseDoctor.statusText);
      }
    } catch (error) {
      console.error("An error occurred:", error);
    }
  };

  return (
    <>
      <link
        href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.2/dist/css/bootstrap.min.css"
        rel="stylesheet"
        integrity="sha384-T3c6CoIi6uLrA9TneNEoa7RxnatzjcDSCmG1MXxSR1GAsXEV/Dwwykc2MPK8M2HN"
        crossOrigin="anonymous"
      ></link>
      <Header />
      {/* <form>
                <input value={name} onChange={(e) => setName(e.target.value)} type="text" placeholder="name" />
                <button onClick={onSubmit} type="submit">submit</button>
            </form>    */}
      <button onClick={onSubmit} type="submit">submit</button>
            {dataHospital && (
                <div>
                    <p>Name : {dataHospital.data[0].name}</p>
                    <p>Email : {dataHospital.data[0].email}</p>
                    <p>Password : {dataHospital.data[0].password}</p>
                    <p>Password : {dataHospital.data[0].servicesArray}</p>
                </div>
            )}

            {dataDoctor && (
                <div>
                    <p>Name : {dataDoctor.data[0].name}</p>
                    <p>Email : {dataDoctor.data[0].email}</p>
                    <p>Password : {dataDoctor.data[0].password}</p>
                    <p>Education : {dataDoctor.data[0].education}</p>
                    <p>specialities : {dataDoctor.data[0].specialityArray}</p>
                </div>
            )}

      <div className="rootParentSearch">
        <div className="searchBlock">
          <div className="input-group mb-3">
            <input
              type="text"
              className="form-control"
              placeholder="Enter Name or Role"
              aria-label="Recipient's username"
              aria-describedby="button-addon2"
            />
            <button
              className="btn btn-outline-secondary"
              type="button"
              id="button-addon2"
            >
              Search
            </button>
          </div>
        </div>

        <div className="FilterBlock">
          <div className="proffessionBlock">
            <div className="professionText">Profeessions</div>
            <div className="proffessions">
              <div className="surgeonBlock pbele">Surgeon</div>
              <div className="orthopedicsBlock pbele">Surgeon</div>
              <div className="radiologyBlock pbele">Surgeon</div>
              <div className="entBlock pbele">Surgeon</div>
            </div>
          </div>
          <div className="salaryBlock">
            <div className="salaryText">Salary</div>
            <div className="salaryRanges">
              <div className="rangel pbele">Salary</div>
              <div className="range2 pbele">Salary</div>
              <div className="range3 pbele">Salary</div>
              <div className="range4 pbele">Salary</div>
            </div>
          </div>
        </div>
        <div className="displayResult">
          <div className="searchresult">



            <div class="card cardbody">
              <img src="" class="card-img-top" alt="..." />
              <div class="card-body">
                <h5 class="card-title">{dataDoctor.data[0].name}</h5>
                <p class="card-text">
                {/* Name : {dataDoctor.data[0].name} */}
                Email : {dataDoctor.data[0].email}
                </p>
                <a href="#" class="btn btn-primary">
                  send request
                </a>
              </div>
            </div>

    

            

          </div>
        </div>
      </div>

      <script
        src="https://cdn.jsdelivr.net/npm/bootstrap@5.3.2/dist/js/bootstrap.bundle.min.js"
        integrity="sha384-C6RzsynM9kWDrMNeT87bh95OGNyZPhcTNXj1NW7RuBCsyN/o0jlpcV8Qyq46cDfL"
        crossOrigin="anonymous"
      ></script>
    </>
  );
}
